            tasks.Insert(genIndex2 + 4, new PassLegacy("Special ", delegate (GenerationProgress progress)
            {
                for (int k = 0; k < 4; k ++)
                {
                    int x = WorldGen.genRand.Next((int)(Main.maxTilesX * 0.1f), (int)(Main.maxTilesX * 0.9f));
                    int y = WorldGen.genRand.Next((int)Main.worldSurface + 100, Main.maxTilesY - 400);

                    for (int j = 0; j < 40; j++)
                    {
                        for (int i = 0; i < 30; i++)// clear empty space

                        {
                            if (smallChestHouse[j, i] == 2)
                            {
                                Main.tile[x + i, y + j].active(false);
                                Main.tile[x + i, y + j].wall = (ushort)mod.WallType("ShadowWall");
                            }
                            else if (smallChestHouse[j, i] == 1)
                            {
                                ushort tileType = (ushort)mod.TileType("ShadowBrick");
                                Main.tile[x + i, y + j].active(true);
                                Main.tile[x + i, y + j].type = tileType;
                                Main.tile[x + i, y + j].wall = (ushort)mod.WallType("ShadowWall");
                            }
                            else if (smallChestHouse[j, i] == 3)
                            {

                                Main.tile[x + i, y + j].wall = (ushort)mod.WallType("ShadowWall");
                                PlaceChest(x + i, y + j, (ushort)mod.TileType("ShadowContainer"), 0);

                            }
                            else if (smallChestHouse[j, i] == 4)
                            {

                                Main.tile[x + i, y + j].wall = (ushort)mod.WallType("ShadowWall");
                                Main.tile[x + i, y + j].type = TileID.Torches;
                                Main.tile[x + i, y + j].frameY = 22 * 7;
                                Main.tile[x + i, y + j].frameX = 0;

                            }

                        }
                    }
                }
            }));
        }

        public override void PostWorldGen()
        {
            int[] itemsToPlaceInAntChests = {  mod.ItemType("AntWings"),
                       mod.ItemType("Nunchucks"),mod.ItemType("FishSprayer"),mod.ItemType("MarshmallowRifle"), mod.ItemType("SnailFlail") };
            foreach (Chest chest in Main.chest.Where(c => c != null))

            {
                var tile = Main.tile[chest.x, chest.y]; // the chest tile
                if (tile.type == mod.TileType("AntsChest"))
                {
                    // fixed: ice chest replacing
                    chest.item[0].SetDefaults(Main.rand.Next(itemsToPlaceInAntChests));

                    chest.item[1].SetDefaults(mod.ItemType("EarthenBar"));
                    chest.item[1].stack = Main.rand.Next(25, 35);
                    chest.item[2].SetDefaults(ItemID.GoldCoin);
                    chest.item[2].stack = Main.rand.Next(5, 35);
                    chest.item[3].SetDefaults(ItemID.GreaterHealingPotion);
                    chest.item[3].stack = Main.rand.Next(5, 35);
                    chest.item[2].SetDefaults(mod.ItemType("ElementalJaw"));
                    chest.item[2].stack = Main.rand.Next(5, 35);
                }
            }
            int[] itemsToPlaceInVoidChests = {  mod.ItemType("VoidedOrbs"),
                       mod.ItemType("VoidedKnives"),mod.ItemType("VoidBlade"),mod.ItemType("VoidedBow") };
            foreach (Chest chest in Main.chest.Where(c => c != null))

            {
                var tile = Main.tile[chest.x, chest.y]; // the chest tile
                if (tile.type == mod.TileType("VoidChest"))
                {
                    // fixed: ice chest replacing
                    chest.item[0].SetDefaults(Main.rand.Next(itemsToPlaceInVoidChests));


                    chest.item[1].SetDefaults(ItemID.GoldCoin);
                    chest.item[1].stack = Main.rand.Next(10, 40);
                    chest.item[2].SetDefaults(ItemID.GreaterHealingPotion);
                    chest.item[2].stack = Main.rand.Next(5, 35);

                }
            }
        }

        public override void PostUpdate()
        {
            int[] possibleInvaders = new int[6] { mod.NPCType("Ant"), mod.NPCType("FireAnt"), mod.NPCType("ElectricAnt"), mod.NPCType("FlyingAnt"), mod.NPCType("AntCrawlerHead"), mod.NPCType("DragonFlyMini") };

            numInvaders = 1;
            if (downedQueenAnt) { numInvaders += 2; }
            if (NPC.downedMechBossAny) { numInvaders += 1; }
            if (NPC.downedMoonlord) { numInvaders += 2; }
            for (int i = 0; i < numInvaders; i++) { realInvaders.Add(possibleInvaders[i]); }
            NPCs.DRGNGlobalNPC.invaders = realInvaders.ToArray();
            realInvaders.Clear();

            if (SwarmUp)
            {
                if (Main.invasionX == (double)Main.spawnTileX)
                {
                    //Checks progress and reports progress only if invasion at spawn
                    Swarm.CheckSwarmProgress();
                }
                //Updates the custom invasion while it heads to spawn point and ends it
                Swarm.UpdateSwarm();
            }

        }








